# Return the top 10 most frequently occurring words in a string.

def top10(str)
  word_dict = Hash.new{|hash, key| hash[key] = 0 }
  word_list = str.split(' ')
  str.split(' ').each{ |word| word_dict[word] += 1 }
  word_dict.to_a.sort{|a, b| b.last <=> a.last }.take(10).map(&:first) #ugly ugly, experiment with group_by?
end

#python challenge 1
def translate(s)
  answer = ''
  revbet = [*('a'..'z')].reverse
  s.each_char do |c|
    if i = revbet.index(c)
      answer << revbet[i-2]
    else
      answer << c
    end
  end
  answer
end

# python challenge 2
def bottom10_char(str)
  word_dict = Hash.new{|hash, key| hash[key] = 0 }
  str.split('').each{ |char| word_dict[char] += 1 }
  word_dict.to_a.sort{|a, b| a.last <=> b.last }.take(10).map(&:first) #ugly ugly, experiment with group_by?
end

